import requests
from Crypto.Cipher import DES
import base64
from Crypto.Util.Padding import unpad
import json

url = 'https://ctbpsp.com/cutominfoapi/recommand/type/5/pagesize/10/currentpage/1'

params = {
    'type__1017': 'eqGxy7G=DtemqAKGQD/YnhoqAOoodteQ74D'
}

headers = {
    'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/125.0.0.0 Safari/537.36 Edg/125.0.0.0',
}

resp = requests.get(url, params=params, headers=headers)
print(resp.text)

# text = ''
text = resp.text
key = "1qaz@wsx".encode('utf-8')
des = DES.new(key=key, mode=DES.MODE_ECB)
bs = base64.b64decode(text)
bs = des.decrypt(bs)
bs = unpad(bs, 8).decode('utf-8')
print(json.loads(bs))




